import {useState,useEffect} from 'react';
import Globelstyles from './styled/Globelstyles';
import Button from './components/Button'
import Crypto from './components/Crypto';
function App(){
  const [cryptos, setCryptos] = useState<any[]>([])
  useEffect(()=>{
    fetch("https://investing-cryptocurrency-markets.p.rapidapi.com/coins/list?edition_currency_id=12&time_utc_offset=28800&lang_ID=1&sort=PERC1D_DN&page=1", {
      "method": "GET",
      "headers": {
        "x-rapidapi-host": "investing-cryptocurrency-markets.p.rapidapi.com",
        "x-rapidapi-key": "a07f0d8d02mshcb403096e9493b5p193e69jsn15e5aa0c963f"
      }
    })
    .then(response => response.json())
    .then(result => setCryptos(result.data[0].screen_data.crypto_data))
    .catch(err => {
      console.error(err);
    });
  },[])
  console.log(cryptos);

  return (
    <div>
      <Globelstyles />
      <Button />
      <Crypto id={cryptos[0].id} name={cryptos[0].name} inst_price_btc={cryptos[0].inst_price_btc} />
    </div>
  );
}

export default App;
